import './App.css';
import { Routes, Route } from "react-router-dom";

import CategoryList from 'Views/Home/CategoryList';
import FormList from 'Views/Home/FormList';
import NotFound from 'Views/Errors/NotFound';
import Generic from 'Views/Errors/Generic';
import FormBase from 'Views/FormLayout/FormBase';
import PageBase from 'Views/FormLayout/PageBase';

function App() {
  return (
    <main className="App sectionOne" id="main" >
      <div className="container-fluid">
        <div className="row">
          <div className="col-md-8">

            <Routes>

              <Route exact path="/" element={<CategoryList />} />
              <Route path="/Categories/:category" element={<FormList />} />

              <Route path=":form" element={<FormBase />}>
                <Route path=":page" element={<PageBase />} />
              </Route>

              <Route path="/ErrorNotFound" element={<NotFound />} />
              <Route path="/ErrorGeneric" element={<NotFound />} />
              <Route path="/ErrorPageExpired" element={<NotFound />} />
              <Route path="/ErrorNotFound" element={<NotFound />} />
              <Route path="*" element={<NotFound />} />
            </Routes>

          </div>

          <div className="col-md-4">

          </div>
        </div>
      </div>
    </main>
  );
}

export default App;
